using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        // Dictionary to hold the mapping of angles to characters\n        Dictionary<double, char> angleToCharMap = new Dictionary<double, char>();\n\n        // Initial data\n        double initialAngle = 0.0;\n        char initialCharacter = 'a';\n\n        // Add initial data to the dictionary\n        if (!angleToCharMap.ContainsKey(initialAngle))\n        {\n            angleToCharMap[initialAngle] = initialCharacter;\n        }\n\n        // Example of adding a new character for a non-existent angle\n        double newAngle = 45.0;\n        char newCharacter = 'b';\n\n        if (!angleToCharMap.ContainsKey(newAngle))\n        {\n            angleToCharMap[newAngle] = newCharacter;\n        }\n        else\n        {\n            Console.WriteLine("Angle already exists.");\n        }\n\n        // Check for an existing angle and add a character if it doesn't exist\n        double checkAngle = 90.0;\n        char checkCharacter = 'c';\n\n        if (!angleToCharMap.ContainsKey(checkAngle))\n        {\n            angleToCharMap[checkAngle] = checkCharacter;\n        }\n        else\n        {\n            Console.WriteLine("Angle already exists.");\n        }\n\n        // Output the contents of the dictionary\n        foreach (var kvp in angleToCharMap)\n        {\n            Console.WriteLine($"Angle: {kvp.Key}, Character: {kvp.Value}");\n        }\n    }\n}